// SPDX-License-Identifier: MIT
//https://solidity-by-example.org/hacks/signature-replay/
pragma solidity ^0.8.20;
import "../Openzeppelin-contracts/openzeppelin-contracts/contracts/utils/cryptography/ECDSA.sol";
import "../Openzeppelin-contracts/openzeppelin-contracts/contracts/utils/cryptography/MessageHashUtils.sol";

contract MultiSigWallet {
    using ECDSA for bytes32;
    using MessageHashUtils for bytes32;
    address[2] public owners;

    constructor(address[2] memory _owners) payable {
        owners = _owners;
    }

    function deposit() external payable {}

    function transfer(address _to, uint _amount, bytes[2] memory _sigs) external {
        bytes32 txHash = getTxHash(_to, _amount);
        require(_checkSigs(_sigs, txHash), "invalid sig");

        (bool sent, ) = _to.call{value: _amount}("");
        require(sent, "Failed to send Ether");
    }

    function getTxHash(address _to, uint _amount) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(_to, _amount));
    }

    function _checkSigs(
        bytes[2] memory _sigs,
        bytes32 _txHash
    ) private view returns (bool) {
        bytes32 ethSignedHash = _txHash.toEthSignedMessageHash();

        for (uint i = 0; i < _sigs.length; i++) {
            address signer = ethSignedHash.recover(_sigs[i]);
            bool valid = signer == owners[i];

            if (!valid) {
                return false;
            }
        }

        return true;
    }
}

contracts/02_reentrancy_fixed_2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Bank {
    mapping (address => uint) userBalance;
   
    function getBalance(address u) public view returns(uint) {
        return userBalance[u];
    }

    function addToBalance() public payable {
        userBalance[msg.sender] += msg.value;
    }   

    function withdrawBalance() public {

        payable(msg.sender).transfer(userBalance[msg.sender]);
        userBalance[msg.sender] = 0;
    }   
}

contracts/03_reentrancy_fixed_1.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Reentrance {
    mapping (address => uint) userBalance;
   
    function getBalance(address u) public view returns(uint) {
        return userBalance[u];
    }

    function addToBalance() public payable {
        userBalance[msg.sender] += msg.value;
    }   

    function withdrawBalance() public {
        // to protect against re-entrancy, the state variable
        // has to be changed before the call
        uint amount = userBalance[msg.sender];
        userBalance[msg.sender] = 0;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed.");
    }   
}

contracts/04_reentrancy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Reentrance {
    mapping (address => uint) userBalance;
   
    function getBalance(address u) public view returns(uint) {
        return userBalance[u];
    }

    function addToBalance() public payable {
        userBalance[msg.sender] += msg.value;
    }   

    function withdrawBalance() public {
        // send userBalance[msg.sender] ethers to msg.sender
        // if msg.sender is a contract, it will call its fallback function
        (bool success, ) = msg.sender.call{value: userBalance[msg.sender]}("");
        require(success, "Transfer failed.");
        userBalance[msg.sender] = 0;
    }   
}

contracts/05_randomnumber.sol.content:
// SPDX-License-Identifier: MIT
//https://solidity-by-example.org/hacks/randomness/

pragma solidity ^0.8.20;

contract GuessTheRandomNumber {
    constructor() payable {}

    function guess(uint _guess) public {
        uint answer = uint(
            keccak256(abi.encodePacked(blockhash(block.number - 1), block.timestamp))
        );

        if (_guess == answer) {
            (bool sent, ) = msg.sender.call{value: 1 ether}("");
            require(sent, "Failed to send Ether");
        }
    }
}

